g2:c.FREE-TEXT.g2:a.TEXT:
For the satellite flare demo: 
Cooler 1 must be on, cooler 2 (the backup cooler) must be off;
3 communication links must be on;
select FLARE, when the flare hits the satellite, it breaks cooler 1 and cooler 2 is turned on.

g2:c.PROCEDURE.g2:a.TEXT:
make-connection (tv-signal:class signal, 
                switch-location: quantity, city-location: quantity )
city: class city;
begin
       if the down-location of tv-signal is not none 
       then begin
         city = the city named by the down-location of tv-signal;
         create a connection of class switch-connection connected between big-switch newly locating it at right at the position given by switch-location and city newly locating it at top at the position given by city-location;
        end 
end

nearest-flag()
d:class destination;
s:class signal;
begin 

  for s = each signal do
    conclude that the down-location of s is none; 
    for d = each destination do
        if the distance between s and d < 100
            then 
                conclude that the down-location of s = the name of d
    end
  end;
end

charging (city:class city)
bill: class bill;
begin
case (the name of city) of
    washington:    bill = washington-bill;
    london:         bill = london-bill;
    paris:            bill = paris-bill;
end;
conclude that the current-usage of bill = the current-usage of bill + 1;
conclude that the total-cost of bill = the tv-rate of bill * the current-usage of bill;

end

shutdown(handle:integer,info: item-or-value,index:integer)
w:class kb-workspace;
begin
for w = each kb-workspace do 
   hide w;
end;
reset knowledge-base;
change the text of the g2-user-mode of
 this window to "administrator";

end
